Defendant Steven C Swiskoski in court, in custody, with attorney Kevin Michael Gaertner.   Ted S. Szczupakiewicz appeared for the State of Wisconsin.  Recommendations by the State.  Arguments by the Defense.  Statement by P.C.  Statement by defendant.  

The Court Orders the Following:
Imposed Sentence of:
10 Years Imprisonment (Credit - 176 days )
-	5 Years of Initial Confinement
-	5 Years of Extended Supervision

Conditions of Extended Supervision:
-            Register as a sex offender
-	AODA Assessment and follow through with any treatment recommended;
-	Mental Health Evaluation and follow through with any treatment recommended;
-	Absolute Sobriety; Random U.A.s;
-	No Use or Possession of alcohol or illegal drugs or drug paraphernalia;
-	No Use or Possession of prescription drugs without a valid prescription;
-	Any valid prescription drugs must be taken in the manner in which they are prescribed;
-	Inform agent of all prescriptions;
-	Sign Medical Release for Agent;
-	Perform  20 hours of community service each year of Extended Supervision; (Community service in the last year of Extended Supervision to be completed by the 10th month.)
-	Follow through with any treatment and/or counseling recommended by Agent;
-	Take a Cognitive Thinking Course;
-           Obtain a Valid Drivers License within 6 months of release
-	Operate a Motor Vehicle with a Valid Drivers License;
-	Maintain/Obtain full time employment;
-	Provide DNA sample if not yet provided  and pay surcharge;
-	No contact with HLB, DOB 03/11/2000
-            No contact with any minor under the age of 18
-            Take an Anger Management Course
-            
Restitution: $0
Cost: $268.00
DNA surcharge: $250.00
(To to be paid at the rate of $50  per month commencing during the 7th month of Extended Supervision)

Defendant is not eligible for the Challenge Incarceration Program
Defendant is not eligible for the Substance Abuse Program
